// Define API configuration first




  const  body__ = {
      user: "Admin",
      password: "GenAI@7070",
      token: "GenAI-CountryCodes",
    }



export const createAuthConfig = (apiUrl, data) => {
  return {
    url: `${apiUrl}`,
    method: "post",
    data,
  };
};

export const signupApi = async (data) => {
  const apiName = "signup";
  const config = await createAuthConfig(apiName, data);
  try {
    const response = await axios(config);
    return response.data;
  } catch (error) {
    console.log("error", error);
    throw error;
  }
};
